import React from "react";
import { Link} from "react-router-dom";
import { FaCode } from "react-icons/fa";
import './projcard.css';

function ProjCard(props) {
    console.log(props.title);
  return (
    <React.Fragment>
    <section id="portfolio">
        <div className="container mt-3 ">
         <div className="row">
            <div className="col-md-4">

            </div>
         </div>
                    <div className="card w-10 projcard border-success rounded">
                        <img src={props.imgsrc} className="card-img-top" alt="Projectpic"/>
                        <div className="card-body text-center ">
                            <h5 className="card-title "><FaCode size={20} style={{color:"green"}}/> {props.title}<FaCode size={20} style={{color:"green"}}/></h5>
                            <Link className="proj-link" to={props.url}>Link to Code</Link>
                </div>
            </div>


        </div>
    </section>
    </React.Fragment>
  )
}

export default ProjCard;
